"""
Given an array of non-negative integers, you are initially positioned at the first index of the array.

Each element in the array represents your maximum jump length at that position.

Your goal is to reach the last index in the minimum number of jumps.

For example:
Given array A = [2,3,1,1,4]

The minimum number of jumps to reach the last index is 2. (Jump 1 step from index 0 to 1, then 3 steps to the last index.)
"""

# f[i] is the minimum number of steps to reach the i+1 th step
# f[0] = 0
# f[i] = min(f[j]) for j in range(i) if A[j] >= i - j


class Solution:
    # @param A, a list of integers
    # @return an integer
    def jump(self, A):

        f = len(A) * [float('inf')]
        f[0] = 0

        for i in range(len(A)):
            steps = float('inf')
            for j in range(i):
                if f[j] < steps and A[j] >= i - j:
                    steps = f[j]
                    f[i] = f[j] + 1

        return f[len(A) - 1]

    def greedy(self, A):  # more practice
        m = 0
        i = 0
        res = 0
        if (len(A)<=1):
            return 0
        while i<len(A):
            m = max(m,i + A[i])
            if m>0:
                res=res+1
            if m>=len(A)-1:
                return res
            tmp=0
            for j in xrange(i+1,m+1):  # find the farthest j from i + 1 to m, in order to update i. Note that i can jump to any j, since m = max(m, i + A[i]), where i is the already jumped distance, and A[i] is the farthest distance can jump from i.
                if (j+A[j]>tmp):
                    tmp = j+A[j]
                    i = j
        return res


